DROP TRIGGER IF EXISTS `tr_h_group_module_de`;
delimiter ;;
CREATE TRIGGER `tr_h_group_module_de` AFTER DELETE ON `h_group_modules` FOR EACH ROW BEGIN
 declare idd int;
 set idd = OLD.id;
 delete from h_modules where parent = idd;
 delete from h_roles where group_module_id = idd;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table languages
-- ----------------------------
DROP TRIGGER IF EXISTS `duplicate_language`;
delimiter ;;
CREATE TRIGGER `duplicate_language` BEFORE INSERT ON `languages` FOR EACH ROW BEGIN
	declare keyword1 varchar(255);
	declare count int;
	DECLARE msg VARCHAR(255);
	set keyword1 = NEW.keyword ;
	set count = (select count(*) from languages where keyword = keyword1);
	if(count>0)then 
        set msg = "Keyword exists";
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = msg;
    END IF;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
