INSERT INTO `configs` VALUES (53, 'text_chatto_nhatquang', '<p>Nếu những câu trả lời của chúng tôi chưa làm bạn hài lòng. Hãy liên hệ trực tiếp tới Nhật Quang để được hỗ trợ nhanh nhất. Chúng tôi luôn ở đây hỗ trợ bạn (từ Thứ hai - Chủ nhật: 8:00 - 22:00)</p>', NULL, 'Text phần trò chuyện cùng nhật quang', NULL, 1, NULL, NULL, 48, 'EDITOR', 1, '2020-11-10 17:11:08', '2021-03-18 15:15:14', 0, NULL, NULL, 2);
