INSERT INTO `configs` VALUES (58, 'text_footer', '<p>NhatQuang.vn - Trang mua sắm trực tuyến của người Việt</p>\r\n<p>Chào mừng bạn đến Nhật Quang</p>\r\n<p>Nếu bạn đang tìm kiếm một nơi mua sắm trực tuyến hàng đầu Việt Nam thì Nhật Quang là lựa chọn còn gì bằng. Với trải nghiệm trên Nhật Quang, bạn không cần phải xếp hàng, lo lắng về thời gian hay điều kiện thời tiết xấu... vẫn mua được hàng triệu sản phẩm cần thiết đảm bảo chất lượng cho gia đình CHỈ TRONG 5 PHÚT.</p>\r\n<p>Thử trải nghiệm cùng Nhật Quang bạn nhé! Nếu bạn gặp bất kỳ trở ngại nào khi trải nghiệm mua sắm trên Nhật Quang. Đừng ngại liên hệ với chúng tôi qua hotline hoặc email. Nhật Quang luôn sẵn sàng lắng nghe bạn để hoàn thiện việc đem đến những trải nghiệm mua sắm trực tuyến đầy tiện ích.</p>\r\n<p>Nhật Quang luôn bên bạn mọi lúc mọi nơi » Đừng quên đăng ký nhận thông báo từ Nhật Quang để luôn là người sớm nhất nhận thông tin Deal sốc và các chương trình khuyến mãi khủng từ Nhật Quang nhé!</p>', NULL, 'Text footer', NULL, 1, NULL, NULL, 48, 'EDITOR', 1, '2020-11-10 17:11:08', '2021-05-17 16:20:21', 0, NULL, NULL, 2);
