INSERT INTO `configs` VALUES (71, 'content_gp1', '<p>Laikep.vn sẽ giúp bạn trở thành một <span style=\"color: #fa1d1d;\">nhà đầu tư chuyên nghiệp</span> trong <span style=\"color: #fa1d1d;\">thời gian ngắn nhất.</span></p>\r\n<p>Tiếp cận các <span style=\"color: #fa1d1d;\">phương pháp</span> và <span style=\"color: #fa1d1d;\">chiến lược</span> đầu tư hiệu quả, đảm bảo <span style=\"color: #fa1d1d;\">an toàn vốn</span> trong dài hạn.</p>', NULL, 'Nội dung phần giải pháp 1', NULL, 1, NULL, NULL, 51, 'EDITOR', 5, '2020-11-10 17:11:08', '2021-05-26 15:51:54', 0, NULL, NULL, 2);
INSERT INTO `configs` VALUES (72, 'content_gp2', '<p><!--(figmeta)eyJmaWxlS2V5IjoiVzJLb0IyYTBXUnk1MVU4RkVPTm1tbyIsInBhc3RlSUQiOjU5MzU4OTkyLCJkYXRhVHlwZSI6InNjZW5lIn0K(/figmeta)--><!--(figma)(/figma)-->Laikep.vn tạo ra môi làm việc giúp bạn <span style=\"color: #fa1d1d;\">tự do xây dựng</span> và <span style=\"color: #fa1d1d;\">phát triển sự nghiệp</span> của mình.</p>\r\n<p><!--(figmeta)eyJmaWxlS2V5IjoiVzJLb0IyYTBXUnk1MVU4RkVPTm1tbyIsInBhc3RlSUQiOjE1MjgzMDA3MDAsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)-->Thu nhập gia tăng <span style=\"color: #fa1d1d;\">bền vững</span>, tăng trưởng <span style=\"color: #fa1d1d;\">không giới hạn.</span></p>', NULL, 'Nội dung phần giải pháp 2', NULL, 1, NULL, NULL, 51, 'EDITOR', 6, '2020-11-10 17:11:08', '2021-05-26 15:51:54', 0, NULL, NULL, 2);
