INSERT INTO `configs` VALUES (101, 'comment_pay_commission', '<p class=\"fs-16-cover\">Hoa hồng được tính dựa vào % doanh thu của mỗi tài khoản</p>\r\n<p><img class=\"img-fluid smooth w-100\" title=\"\" src=\"frontend/images/image.png\" alt=\"\" /></p>\r\n<div class=\"s-content fs-16-cover mt-3\">\r\n<div class=\"row\">\r\n<div class=\"col-lg-6 mb-3 mb-xl-4\">\r\n<p><strong>Rank:</strong></p>\r\n<p>- Mỗi lần lên hạng sẽ được tăng tỷ lệ hoa hồng trực tiếp và nhận tiền thưởng lên hạng.</p>\r\n<p>- Hệ thống sẽ update hạng 1 tháng 1 lần.</p>\r\n<p>- Thành viên chỉ có thể tăng tối đa 1 hạng trong 1 tháng.</p>\r\n<p>- Thành viên chỉ có thể tụt tối đa 1 hạng trong 1 tháng.</p>\r\n<p>- Thành viên chỉ có thể bị tụt tối đa 2 hạng so với hạng cao nhất mà họ đã đạt được.</p>\r\n<p>- Nếu bị tụt hạng, điều kiện để lên lại hạng:</p>\r\n<p class=\"pl-3 pl-xl-4\">+ Bán đủ số SP đang bị âm, cộng dồn hàng tháng (tối đa 3 SP). (+ điều kiện bảo trợ F1 lên hạng)</p>\r\n<p class=\"pl-3 pl-xl-4\">+ Đối với việc lên lại cấp phó GĐ hoặc GĐ, cần đạt được mức thu nhập tối thiểu ở tháng tiếp theo. (+ điều kiện bảo trợ F1 lên hạng)</p>\r\n</div>\r\n<div class=\"col-lg-6 mb-3 mb-xl-4 border-left\">\r\n<div class=\"px-xl-4\"><strong>Tài khoản bị khóa chức năng rút tiền</strong> nếu sau 30 ngày (kể từ ngày bán được SP gần nhất) không phát sinh hoa hồng trực tiếp (tức là không bán được thêm SP nào qua link liên kết), tài khoản sẽ tạm thời bị khóa chức năng rút tiền. Chức năng rút tiền sẽ tự động được mở lại khi TK phát sinh hoa hồng trực tiếp. Nếu thành viên không bán hàng, số lượng SP cần bán để mở khóa sẽ được cộng dồn, cộng dồn tối đa 3 SP. + Trong thời gian TK bị khóa chức năng rút tiền, TK vẫn nhận được hoa hồng hệ thống bình thường. Tất cả các chức năng khác của TK vẫn hoạt động bình thường. + Điều kiện này không áp dụng đối với cấp Phó Giám Đốc trở lên.</div>\r\n</div>\r\n<div class=\"col-12\">\r\n<p><strong>Vượt cấp:</strong></p>\r\n<p>F0 sẽ nhận được 6% doanh số bán hàng trực tiếp của F1. Tuy nhiên, nếu F1 có thứ hạng (rank) cao hơn F0, thì F0 sẽ nhận được ít hoa hồng hơn (vì F0 phải hoàn trả lại 1 phần hoa hồng cho F1).</p>\r\n<p>F1 cao hơn 1 cấp so với F0: F0 chỉ nhận được 80% của 6% (tức 4.8%), và F1 nhận được 20% của 6% (tức 1.2%).</p>\r\n<p>F1 cao hơn 2 cấp so với F0: F0 chỉ nhận được 65% của 6% (tức 3.9%), và F1 nhận được 35% của 6% (tức 2.1%).</p>\r\n<p>F1 cao hơn 3 cấp so với F0: F0 chỉ nhận được 50% của 6% (tức 3.0%), và F1 nhận được 50% của 6% (tức 3.0%).</p>\r\n<p>F1 cao hơn 4 cấp so với F0: F0 chỉ nhận được 35% của 6% (tức 2.1%), và F1 nhận được 65% của 6% (tức 3.9%).</p>\r\n<p>F1 cao hơn 5 cấp so với F0: F0 chỉ nhận được 20% của 6% (tức 1.2%), và F1 nhận được 80% của 6% (tức 4.8%).</p>\r\n<p>(1 tháng update hạng 1 lần)</p>\r\n</div>\r\n</div>\r\n</div>', NULL, 'Nội dung tri trả hoa hồng', NULL, 1, NULL, NULL, 61, 'EDITOR', 1, '2020-11-10 17:11:08', '2021-06-11 09:00:39', 0, NULL, NULL, 1);
